import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <header className="header bg-light shadow-sm p-3">
            <div className="container d-flex justify-content-between align-items-center">
                <div className="logo">
                    <h1 className="text-danger logo-title">BOOK RENTAL WEBSITE</h1>
                </div>
                <nav className="nav">
                    <ul className="list-unstyled d-flex">
                        <li className="me-3">
                            <button className="btn btn-outline-dark">Cart</button>
                        </li>
                        <li>
                            <button className="btn btn-danger">Login</button>
                        </li>
                    </ul>
                </nav>
            </div>
            <div className="search-container">
                <input type="text" className="form-control" placeholder="Search for book, author..." />
                <button className="btn btn-danger">Search</button>
            </div>
        </header>
    );
};

export default Header;
